    public static Object convertJsonNode(Object inputObject) {
//        Object inputObject = new JSONTokener(jsonString).nextValue();

        // Transform the JSON structure
        List<Object> outputList = transformInput(inputObject);

        //   JSONObject inputJsonObject = (JSONObject) inputObject;
        //  JSONObject res= transformJsonObject(inputJsonObject);
        // Print the transformed output
        System.out.println("Transformed Output is *********: " + outputList);

        return outputList;
    }
    private static List<Object> transformInput(Object inputObject) {
        List<Object> outputList = new ArrayList();
        if (inputObject instanceof JSONArray) {
            JSONArray myArrayList = (JSONArray) inputObject;
            for (int i = 0; i < myArrayList.length(); i++) {
                // Check if "map" is present before attempting to retrieve it
                JSONObject currentObject = myArrayList.optJSONObject(i);
                if (currentObject != null && currentObject.has("map")) {
                    JSONObject map = currentObject.getJSONObject("map");
                    JSONObject outputObject = transformJsonObject(map);
                    outputList.add(outputObject);
                }
            }
        } else if (inputObject instanceof JSONObject && ((JSONObject) inputObject).has("myArrayList")) {
            JSONObject inputJsonObject = (JSONObject) inputObject;
            JSONArray myArrayList = inputJsonObject.getJSONArray("myArrayList");
            for (int i = 0; i < myArrayList.length(); i++) {
                // Check if "map" is present before attempting to retrieve it
                JSONObject currentObject = myArrayList.optJSONObject(i);
                if (currentObject != null && currentObject.has("map")) {
                    JSONObject map = currentObject.getJSONObject("map");
                    JSONObject outputObject = transformJsonObject(map);
                    outputList.add(outputObject);
                }else{
                    outputList.addAll(transformJsonArray(myArrayList));
                }
            }
        }else{
            outputList.add(transformJsonObject((JSONObject) inputObject));
        }

        return outputList;
    }

    private static JSONObject transformJsonObject(JSONObject inputObject) {
        JSONObject outputObject = new JSONObject();
        List<Object> outputList = new ArrayList();
        Iterator<String> keys = inputObject.keys();
        while (keys.hasNext()) {
            String key = keys.next();
            Object value = inputObject.get(key);

            if (value instanceof JSONObject && ((JSONObject) value).has("myArrayList")) {
                outputObject.put(key, transformJsonArray(((JSONObject) value).getJSONArray("myArrayList")));
            } else if (value instanceof JSONArray ){
                JSONArray myArrayList = (JSONArray) value;
                for (int i = 0; i < myArrayList.length(); i++) {
                    // Check if "map" is present before attempting to retrieve it
                    JSONObject currentObject = myArrayList.optJSONObject(i);
                    if (currentObject != null && currentObject.has("map")) {
                        JSONObject map = currentObject.getJSONObject("map");
                        // JSONObject outputObject = ;
                        outputList.add(transformJsonObject(map));
                        outputObject.put(key, outputList);

                    }else{
                        outputList.addAll(transformJsonArray(myArrayList));
                    }
                }
            } else if(value instanceof JSONObject){
                outputObject.put(key, transformJsonObject((JSONObject) value));
            }
            else {
                outputObject.put(key, value);
            }
        }

        return outputObject;
    }

    private static List<Object> transformJsonArray(JSONArray inputArray) {
        List<Object> outputList = new ArrayList();

        for (int i = 0; i < inputArray.length(); i++) {
            Object element = inputArray.get(i);

            if (element instanceof JSONObject) {
                outputList.add(transformJsonObject((JSONObject) element));
            } else {
                outputList.add(element);
            }
        }
        return outputList;
    }

